This problem can be solved programmatically using GNU Octave. The probability of choosing a boy and a girl from a group of 20 members (12 boys and 8 girls) can be calculated using the combination formula and the probability rules. The combination formula is used to calculate the number of ways to choose 2 members from the group of 20, and the probability rules are used to calculate the probability of choosing a boy and a girl.

Here is the Octave code to calculate the probability:

```octave
function prob_boy_girl
  total_members = 20;
  boys = 12;
  girls = 8;

  % Calculate the number of ways to choose 2 members from the group of 20
  total_ways = nchoosek(total_members, 2);

  % Calculate the number of ways to choose 1 boy and 1 girl
  boy_girl_ways = nchoosek(boys, 1) * nchoosek(girls, 1);

  % Calculate the probability
  prob = boy_girl_ways / total_ways;

  return prob;
end

result = prob_boy_girl();
disp(result);
```

This code will output the probability of choosing a boy and a girl from the group of 20 members.

