The problem can be solved programmatically using GNU Octave. We can use the shoelace formula to calculate the area of the quadrilateral. The shoelace formula states that if the vertices of a polygon are listed counterclockwise as $(x_1, y_1), (x_2, y_2), \ldots, (x_n, y_n)$, then its area is given by

$$\frac{1}{2} |(x_1y_2 + x_2y_3 + \cdots + x_ny_1) - (y_1x_2 + y_2x_3 + \cdots + y_nx_1)|.$$

In this case, the vertices of the quadrilateral are $(-1, 0)$, $(0, 1)$, $(2, 0)$, and $(0, -3)$. We can list the coordinates in counterclockwise order as $(x_1, y_1) = (-1, 0)$, $(x_2, y_2) = (0, 1)$, $(x_3, y_3) = (2, 0)$, and $(x_4, y_4) = (0, -3)$.

We can then plug these coordinates into the shoelace formula to calculate the area of the quadrilateral. Here's a simple Octave function to do this:

```octave
function area = quadrilateral_area()
  x = [-1, 0, 2, 0];
  y = [0, 1, 0, -3];

