The problem can be solved programmatically using GNU Octave. The area of the side panel of the stairway can be calculated by finding the area of each individual rectangle and then summing them up.

```octave
function panel_area
  % dimensions of the risers and treads
  riser_height = 8;
  tread_depth = 10;

  % number of risers and treads
  num_risers = 3;
  num_treads = 3;

  % calculate the area of each riser and tread
  riser_area = riser_height * num_risers;
  tread_area = tread_depth * num_treads;

  % calculate the total area
  total_area = riser_area + tread_area;

  % print the total area
  disp(total_area);
end

panel_area()
```
```output
64
```
The area of the side panel of the stairway is $\boxed{64}$ square inches.

