This problem can be solved programmatically using GNU Octave. The function $f(x)$ is its own inverse if $f(f(x)) = x$ for all $x$ in the domain of $f$. We can set up the equation $f(f(x)) = x$ and solve for $k(x)$ using the `fsolve` function in Octave.

