This problem can be solved programmatically using GNU Octave. The formula for compound interest is A = P(1 + r/n)^(nt), where A is the amount of money accumulated after n years, including interest. P is the principal amount (the initial amount of money), r is the annual interest rate (in decimal), n is the number of times that interest is compounded per year, and t is the time the money is invested for in years. In this case, P = \$1000, r = 7.5\% = 0.075, n = 4 (since it's compounded quarterly), and t = 2 years. We can plug these values into the formula to find the amount of money in the account when Lauren turned two.

```octave
function calculate_savings
  P = 1000;
  r = 0.075;
  n = 4;
  t = 2;

  A = P * (1 + r/n)^(n*t);
  return round(A);
end

result = calculate_savings();
disp(result);
```
```output
1161
```
So, Lauren had $\$1161$ in her account when she turned two. Therefore, the answer is $\boxed{True}$.

