First, let's consider the case where Pierre and Thomas sit together. We can treat them as a single entity. So, we have 7 entities in total (6 individuals and 1 pair). There are (7-1)! = 6! ways to arrange these entities in a circle.

Now, let's consider the case where Pierre and Thomas sit together and Rosa sits next to either of them. We can treat Pierre and Thomas as a single entity and Rosa and one of them (let's say Pierre) as another single entity. So, we have 6 entities in total (5 individuals and 1 pair). There are (6-1)! = 5! ways to arrange these entities in a circle.

So, the number of ways where Pierre and Thomas sit together and Rosa doesn't sit next to them is 6! - 5! = 5!(6-1) = 5! * 5 = 24 * 5 = 120.

Therefore, the answer is $\boxed{True}$.

