This problem can be solved programmatically using the principle of inclusion-exclusion. The total number of people wearing at least one of the items is the sum of the number of people wearing each item minus the number of people wearing two items (since they are counted twice) plus the number of people wearing all three items (since they are counted three times).

Let's denote the number of people wearing all three items as x. We can set up the following equation:

110 (sunglasses) + 70 (bathing suits) + 95 (hats) - 30 (sunglasses and bathing suits) - 25 (bathing suits and hats) - 40 (sunglasses and hats) + x (all three items) = 190 (total people)

We can solve this equation for x to find the number of people wearing all three items.

```octave
function x = all_three_items()
  total_people = 190;
  sunglasses = 110;
  bathing_suits = 70;
  hats = 95;
  two_items = 30 + 25 + 40;

  x = total_people - sunglasses - bathing_suits - hats + two_items;
end

result = all_three_items();
disp(result);
```
```output
20
```
The number of people wearing all three items is $\boxed{20}$.

So, the answer is $\boxed{True}$.

