This problem can be solved programmatically using the combination formula in GNU Octave. The combination formula is C(n, k) = n! / (k!(n-k)!), where n is the total number of items, k is the number of items to choose, and ! denotes the factorial function.

In this case, Liz has 11 marbles and she wants to choose 3 of them. However, she refuses to choose the green and purple marbles at the same time. This means that we need to consider two cases:

1. She chooses the green or purple marble. In this case, she has 9 marbles to choose from (11 total minus the green and purple ones), and she wants to choose 3. So we calculate C(9, 3).

2. She does not choose the green or purple marble. In this case, she has 11 marbles to choose from, and she wants to choose 3. So we calculate C(11, 3).

The total number of ways she can choose 3 marbles is the sum of these two cases.

```octave
function total_ways
    total_marbles = 11;
    green_purple_marbles = 2;
    ways_to_choose_3 = 3;

    # Case 1: She chooses the green or purple marble
    ways_case1 = nchoosek(total_marbles - green_purple_marbles, ways_to_choose_3);

    # Case 2: She does not choose the green or purple marble
    ways_case2 = nchoosek(total_marbles, ways_to_choose_3);

    # Total ways
    total_ways = ways_case1 + ways_case2;

    return total_ways;
end

result = total_ways();
disp(result);
```
```output
165
```
The answer is $\boxed{165}$.

