This problem can be solved programmatically using GNU Octave. The prime numbers on a six-sided die are 2, 3, and 5. Therefore, the probability of rolling a prime number on one die is 3/6 = 1/2. The probability of not rolling a prime number on one die is 1 - 1/2 = 1/2. Since the rolls of the dice are independent, the probability of not rolling a prime number on both dice is (1/2) * (1/2) = 1/4.

```octave
function probability = calculate_probability()
  prime_numbers = [2, 3, 5];
  total_numbers = 1:6;
  prime_probability = length(intersect(prime_numbers, total_numbers)) / length(total_numbers);
  non_prime_probability = 1 - prime_probability;
  probability = non_prime_probability^2;
end

result = calculate_probability();
disp(result);
```
```output
0.25000
```
The probability that Adam did not roll a prime number on either die is $\boxed{\frac{1}{4}}$. So, the answer is $\boxed{True}$.

