    y2 = 10;

    midpoint_x = (x1 + x2) / 2;
    midpoint_y = (y1 + y2) / 2;

    sum_of_coordinates = midpoint_x + midpoint_y;

    return sum_of_coordinates;
end

result = sum_of_coordinates();
disp(result);
```
