This problem can be solved programmatically using GNU Octave. The rotation of a complex number $z$ by an angle $\theta$ around a complex number $c$ can be computed using the formula $z' = c + (z - c) \cdot e^{i\theta}$. In this case, we want to rotate $3$ by $90^\circ$ (or $\pi/2$ radians) in the clockwise direction around $-4 - 5i$. So we can use the following code:

```octave
function result = rotate_complex_number()
  z = 3;
  c = -4 - 5i;
  theta = -pi/2; % clockwise rotation

  z_prime = c + (z - c) * exp(i * theta);

  result = z_prime;
end

result = rotate_complex_number();
disp(result);
```

This code will output the resulting complex number after the rotation. So the answer is $\boxed{True}$.

