```octave
function expected_value
  deck = 52;
  aces = 4;
  twos_to_tens = 36;
  face_cards = 12;
  spades = 13;
  clubs = 13;

  # Probability of drawing an ace
  p_ace = aces / deck;

  # Probability of drawing a 2 through 10
  p_2_to_10 = twos_to_tens / deck;

  # Probability of drawing a face card
  p_face_card = face_cards / deck;

  # Probability of drawing a spade
  p_spade = spades / deck;

  # Probability of drawing a club
  p_club = clubs / deck;

  # Expected value for each outcome
  expected_value_ace = 1;
  expected_value_2_to_10 = 2:10;
  expected_value_face_card = 20;
  expected_value_spade = 3 * expected_value_face_card;
  expected_value_club = 2 * expected_value_face_card;

  # Total expected value
  total_expected_value = p_ace * expected_value_ace + p_2_to_10 * mean(expected_value_2_to_10) + p_face_card * expected_value_face_card + p_spade * expected_value_spade + p_club * expected_value_club;

  return total_expected_value;
end

result = expected_value();
printf("%.2f", result);
