The units digit of a double factorial $n!!$ is determined by the units digit of the product of all odd integers less than or equal to $n$. Since the units digit of an odd number times an odd number is always 1, we can conclude that the units digit of $n!!$ is always 1.

Therefore, the units digit of $1!! + 3!! + 5!! + 7!! + \cdots + 49!!$ is the same as the units digit of the sum of 1's, which is 1.

Here is a GNU Octave program to calculate the sum:

```octave
function result = calculate_sum()
  total = 0;
  for n = 1:2:49
    total += n;
  end
  result = total;
end

result = calculate_sum();
units_digit = result % 10;
disp(units_digit);
```
