function common_factors
    # Find the factors of 100 and 150
    factors_100 = factor(100);
    factors_150 = factor(150);

    # Find the common factors
    common_factors = intersect(factors_100, factors_150);

    # Count the number of common factors
    num_common_factors = length(common_factors);

    return num_common_factors;
end

result = common_factors();
disp(result);
```
