function smallest_product
    % Get all prime numbers from 1 to 100
    primes = primesfrom2to(1, 100);

    % Get all one-digit prime numbers
    one_digit_primes = primes(primes <= 9);

    % Get all two-digit prime numbers
    two_digit_primes = primes(primes > 9 & primes < 100);

    % Initialize the smallest product as infinity
    smallest_product = Inf;

    % Iterate over all one-digit prime numbers
    for i = 1:numel(one_digit_primes)
        % Iterate over all two-digit prime numbers
        for j = 1:numel(two_digit_primes)
            % Iterate over all remaining two-digit prime numbers
            for k = j+1:numel(two_digit_primes)
                % Calculate the product
                product = one_digit_primes(i) * two_digit_primes(j) * two_digit_primes(k);
                % Update the smallest product if necessary
                if product < smallest_product
                    smallest_product = product;
                end
            end
        end
    end

    % Print the smallest product
    disp(smallest_product);
end

smallest_product = smallest_product();
