This problem can be solved programmatically using GNU Octave. 

The maximum number of points where at least two of the circles intersect can be found by considering the number of ways to choose two circles out of the four. This can be calculated using the combination formula:

C(n, k) = n! / (k!(n-k)!)

where n is the total number of circles (4 in this case) and k is the number of circles we are choosing (2 in this case).

So, we can calculate the number of intersection points as follows:

```octave
function intersection_points
    n = 4;
    k = 2;
    intersection_points = nchoosek(n, k);
    return intersection_points;
end

