This problem can be solved programmatically using GNU Octave. The expected value of the sum of the rolls of two eight-sided dice can be calculated using the formula:

Expected value = (sum of all possible outcomes) / (number of possible outcomes)

In this case, the sum of all possible outcomes is the sum of the numbers from 1 to 8, and the number of possible outcomes is 8 * 8 = 64 (since each die has 8 faces).

Here's a GNU Octave script to calculate the expected value:

```octave
function expected_value
    sum_all_outcomes = sum(1:8);
    num_outcomes = 8 * 8;

    expected_value = sum_all_outcomes / num_outcomes;

    return expected_value;
end

result = expected_value();
disp(result);
```
```output
4.5
```
The expected value of the sum of the rolls of both dice is 4.5. Therefore, the answer is $\boxed{True}$.

